// import './App.css';
import React from 'react';
import HomePage from './pages/HomePage';

function App() {
  return (

    <div >
      <BrowserRouter >
        <Routes>
          <Route path="/" element={<HomePage />} />
        </Routes>

      </BrowserRouter>
    </div >
  );
}

export default App;
